            return 0
        if len(chosen) == 1:
            return chosen[0] % k

        total_sum = sum(chosen) % k
        max_sum = total_sum
        for i in range(len(chosen)):
            if i == 0 or chosen[i] != chosen[i - 1]:
                new_chosen = [chosen[i]]
                for j in range(i + 1, len(chosen)):
                    if chosen[j] != chosen[i]:
                        new_chosen.append(chosen[j])
                        max_sum = max(max_sum, choose_elements(row, new_chosen))
                max_sum = max(max_sum, choose_elements(row, new_chosen[:-1]))
        return max_sum

    max_sum = 0
    for i in range(n):
        row = matrix[i]
        chosen = []
        for j in range(len(row)):
            if j < len(row) // 2 or len(row) % 2 == 1:
                chosen.append(row[j])
        max_sum = max(max_sum, choose_elements(row, chosen))

    return max_sum

