    n, a = map(int, stdin.split())
    a = list(map(int, a.split()))

    def is_increasing(arr):
        return all(arr[i] < arr[i + 1] for i in range(len(arr) - 1))

    def find_longest_increasing_subsequence(arr):
        tails = [0] * n
        length = 1
        for num in arr:
            i, j = 0, length
            while i < j:
                mid = (i + j) // 2
                if tails[mid] < num:
                    i = mid + 1
                else:
                    j = mid
            tails[i] = num
            length = max(length, i + 1)
        return length

    longest_increasing_subsequence = find_longest_increasing_subsequence(a)
    result = [0] * longest_increasing_subsequence

    for i in range(longest_increasing_subsequence - 1, -1, -1):
        tails = [0] * (i + 1)
        j = 0
        for num in a:
            if is_increasing(tails) and tails[-1] < num:
                tails[j] = num
                j = min(j + 1, i)
        if is_increasing(tails):
            result[i] = 'L'
        else:
            result[i] = 'R'
            result = result[:i]
            break

    return str(longest_increasing_subsequence) + '\n' + ''.join(result)

