def solution(stdin: str) -> str:
    n, k = map(int, stdin.split())
    s = list(input())

    def is_subsequence(t, s):
        i = 0
        for c in s:
            if i < len(t) and c == t[i]:
                i += 1
        return i == len(t)

    def all_subsequences(s):
        for i in range(len(s) + 1):
            for t in itertools.combinations(s, i):
                yield ''.join(t)

    subsequences = set(all_subsequences(s))
    filtered_subsequences = set(filter(lambda t: is_subsequence(t, s), subsequences))

    if len(filtered_subsequences) < k:
        return -1

    costs = [n - len(t) for t in filtered_subsequences]
    return min(costs)

