    MOD = 1000000007

    def dfs(pos, depth, open_count, close_count):
        if pos == len(s) and open_count == close_count:
            return 1
        if pos == len(s) or depth == 2 * n:
            return 0

        result = 0
        if s[pos] == '(':
            result += dfs(pos + 1, depth + 1, open_count + 1, close_count)
