        # If they are, return the perimeter of the rectangle formed by a and b tiles
        return str(2 * (a + b))

    # Check if a is greater than b
    if a > b:
        # If it is, swap a and b
        a, b = b, a

    # Calculate the perimeter of the rectangle formed by a and b tiles
    perimeter = 2 * (a + b)

    # Check if a is odd
    if a % 2 == 1:
        # If it is, add the missing side to form a rectangle
        perimeter += 1

    # Check if b is odd
    if b % 2 == 1:
        # If it is, add the missing side to form a rectangle
        perimeter += 1

    # Return the perimeter of the rectangle
    return str(perimeter)

