    assert(1 <= n <= 1000 and 1 <= m <= 1000 and 1 <= d <= 1000 and m <= n and sum(c) <= n)

    # Initialize the river with 0s and 1s for platforms
    river = [0] * (n + 2)
    river[0] = 1
    river[n + 1] = 1

    # Check if there is a valid solution
    def check_solution() -> bool:
        for i in range(n + 1):
            if river[i] == 1 and i + d > n:
                return False
        return True

    # Move platforms left or right
    def move_platform(i: int, j: int) -> None:
        while i < j:
            river[i], river[j] = river[j], river[i]
            i += 1
            j -= 1

    # Check if platforms do not intersect
    def check_intersection() -> bool:
        for i in range(n + 2):
            if river[i] != 0 and i + c[river[i] - 1] > n:
                return False
        return True

    if not check_solution():
        return "NO"

    # Move platforms until we start jumping
    while not check_intersection():
        for i in range(1, m + 1):
            if c[i - 1] + river[i] <= n:
                move_platform(i, c[i - 1] + river[i])
            if c[i - 1] - river[i] >= 1:
                move_platform(i, c[i - 1] - river[i])

    # Print the answer
    ans = [0] * (n + 2)
    for i in range(1, m + 1):
        if river[i] == 0:
            continue
        ans[c[river[i] - 1] + river[i]] = river[i]
