    def can_be_obtained(number, target):
        if number % 3 == 0 and number // 3 == target:
            return True
        if number * 2 == target:
            return True
        return False

    # Helper function to check if the given sequence can be rearranged
    def can_rearrange(numbers):
        for i in range(1, len(numbers)):
            if not can_be_obtained(numbers[i-1], numbers[i]):
                return False
        return True

    # Function to reorder the sequence
    def reorder(numbers):
        result = []
        i = 0
        while len(result) < len(numbers):
            for j in range(i, len(numbers)):
                if can_be_obtained(numbers[i-1], numbers[j]):
                    result.append(numbers[j])
                    i = j + 1
                    break
            if i == len(numbers):
                return None
        return result

    # Check if the given sequence can be rearranged
    if not can_rearrange(numbers):
        return "The sequence cannot be rearranged."

    # Rearrange the sequence and return the result
    result = reorder(numbers)
    if result is None:
        return "The sequence cannot be rearranged."
    return " ".join(str(x) for x in result)

