    graph = {i: {"weight": a[i], "neighbors": set()} for i in range(n)}

    # Add edges from special offers
    for x, y, w in special_offers:
        graph[x-1]["neighbors"].add((y-1, w))
        graph[y-1]["neighbors"].add((x-1, w))

    def dfs(graph: Dict[int, Dict[str, Union[int, Set]]], visited: Set[int], current: int, current_weight: int, total_weight: int) -> int:
        if current in visited:
            return total_weight
        visited.add(current)

        for neighbor, weight in graph[current]["neighbors"]:
            total_weight = min(total_weight, dfs(graph, visited, neighbor, current_weight + weight, total_weight))

        return total_weight

    # Find the minimum cost to make the graph connected
    min_cost = float('inf')
    for i in range(n):
        visited = set()
        min_cost = min(min_cost, dfs(graph, visited, i, 0, float('inf')))

    return str(min_cost)

