    n, m = map(int, stdin.split()[0:2])
    edges = []
    for i in range(m):
        u, v, w = map(int, stdin.split()[3*i+2:3*i+5])
        edges.append((u-1, v-1, w))

    def find(parent, u):
        if parent[u] != u:
            parent[u] = find(parent, parent[u])
        return parent[u]

    def union(parent, rank, u, v):
        u = find(parent, u)
        v = find(parent, v)
        if u == v:
            return False
        if rank[u] > rank[v]:
            parent[v] = u
        elif rank[u] < rank[v]:
            parent[u] = v
        else:
            parent[v] = u
            rank[u] += 1
        return True

    def kruskal(edges, n):
        edges.sort(key=lambda x: x[2])
        parent = [i for i in range(n)]
        rank = [0] * n
        mst_cost = 0
        mst_edges = []
        for edge in edges:
            if union(parent, rank, edge[0], edge[1]):
                mst_edges.append(edge)
                mst_cost += edge[2]
            if len(mst_edges) == n - 1:
                break
        return mst_cost, mst_edges

    initial_cost, _ = kruskal(edges, n)
    operations = 0
    while True:
        min_cost, _ = kruskal(edges, n)
        if min_cost == initial_cost:
            break
        operations += 1
        for i in range(m):
            u, v, w = edges[i]
            if w == 1:
                continue
            edges[i] = (u, v, w-1)
    return str(operations)

