    # Calculate the total number of votes for each party in each district
    total_votes = {i: {'A': 0, 'B': 0} for i in range(1, D+1)}
    for precinct in precincts:
        district, a, b = precinct
        total_votes[district]['A'] += a
        total_votes[district]['B'] += b

    # Determine the party that wins in each district
    winner = {}
    for district in total_votes:
        votes_a = total_votes[district]['A']
        votes_b = total_votes[district]['B']
        if votes_a > votes_b:
            winner[district] = 'A'
        else:
            winner[district] = 'B'

    # Calculate the wasted votes for each party in each district
    wasted_votes = {i: {'A': 0, 'B': 0} for i in range(1, D+1)}
    for precinct in precincts:
        district, a, b = precinct
        if winner[district] == 'A':
            wasted_votes[district]['B'] += b
        else:
            wasted_votes[district]['A'] += a

    # Calculate the efficiency gap
    total_votes_cast = sum(total_votes[district]['A'] + total_votes[district]['B'] for district in total_votes)
    wasted_votes_a = sum(wasted_votes[district]['A'] for district in wasted_votes)
    wasted_votes_b = sum(wasted_votes[district]['B'] for district in wasted_votes)
    efficiency_gap = abs((wasted_votes_a - wasted_votes_b) / total_votes_cast)

    # Output the results for each district
    result = []
    for district in range(1, D+1):
        result.append(winner[district])
        result.append(wasted_votes[district]['A'])
        result.append(wasted_votes[district]['B'])
    result.append(efficiency_gap)

    return '\n'.join(map(str, result))

