    def bfs(start, end, coins):
        queue = [(start, 0)]
        visited = set()
        while queue:
            curr, dist = queue.pop(0)
            if curr == end:
                return dist
            visited.add(curr)
            for dx, dy in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
                new_x, new_y = curr[0] + dx, curr[1] + dy
                if (0 <= new_x < M and 0 <= new_y < N and coins[new_x][new_y] > coins[curr[0]][curr[1]]):
                    new_dist = dist + coins[new_x][new_y] - coins[curr[0]][curr[1]]
                    if (new_x, new_y) not in visited and new_dist < new_dist:
                        queue.append((new_x, new_y, new_dist))
        return -1

    north_west = (0, 0)
    south_east = (M-1, N-1)
    return str(bfs(north_west, south_east, coins))

