        5: [(0, 2, 4), (2, 4)],
        6: [(0, 2, 4), (2, 4)],
        7: [(0, 2, 4), (2, 4)],
    }

    def is_valid(position: tuple, heights: list) -> bool:
        for x, y in position:
            if x < 0 or x >= C or y >= len(heights):
                return False
            if heights[y] - x < 0:
                return False
        return True

    def rotate_piece(piece: tuple) -> tuple:
        new_piece = []
        for x, y in piece:
            new_piece.append((y, C - 1 - x))
        return tuple(new_piece)

    def move_piece(piece: tuple, delta: int) -> tuple:
        return tuple((x + delta, y) for x, y in piece)

    def count_configurations(piece: tuple, heights: list, used: set) -> int:
        configurations = 0
        for rotation in range(4):
            for i in range(-C, C):
                new_piece = move_piece(piece, i)
                for j in range(rotation):
                    new_piece = rotate_piece(new_piece)
                if is_valid(new_piece, heights) and frozenset(new_piece) not in used:
                    used.add(frozenset(new_piece))
                    configurations += count_configurations(new_piece, heights, used)
                    used.remove(frozenset(new_piece))
        return configurations

    piece = pieces[P]
    used = set()
