    # read input
    t, N, M = map(int, stdin.readline().split())
    grid = [list(stdin.readline().strip()) for _ in range(N)]

    # find starting position
    for i in range(N):
        for j in range(M):
            if grid[i][j] == 'S':
                start_pos = (i, j)
                break
        if start_pos:
            break

    # find exit positions
    exit_positions = []
    for i in range(N):
        for j in range(M):
            if grid[i][j] == 'U':
                exit_positions.append((i, j, 'U'))
            elif grid[i][j] == 'D':
                exit_positions.append((i, j, 'D'))
            elif grid[i][j] == 'L':
                exit_positions.append((i, j, 'L'))
            elif grid[i][j] == 'R':
                exit_positions.append((i, j, 'R'))

    def get_adjacent_positions(position, direction):
        i, j = position
        if direction == 'U':
            return [(i - 1, j)]
        elif direction == 'D':
            return [(i + 1, j)]
        elif direction == 'L':
            return [(i, j - 1)]
        elif direction == 'R':
            return [(i, j + 1)]

    def dfs(position, t):
        visited.add(position)
        if position in exit_positions:
            return 0
        adjacent_positions = get_adjacent_positions(position, grid[position[0]][position[1]])
        min_distance = float('inf')
        for next_position in adjacent_positions:
            if next_position not in visited and 0 <= next_position[0] < N and 0 <= next_position[1] < M:
                if grid[next_position[0]][next_position[1]] != '1':
                    distance = dfs(next_position, t - 1)
                    if distance is not None:
                        min_distance = min(min_distance, distance + 1)
        visited.remove(position)
        if min_distance != float('inf'):
            return min_distance
        return None

    visited = set()
    distance = dfs(start_pos, t)

    if distance is not None:
        return str(distance)
    else:
        return "NOT POSSIBLE"

