        num_bottles.sort(reverse=True)
        refill = [0] * s
        for i in range(s):
            if num_bottles[i] + new_bottles <= d:
                refill[i] = new_bottles
                new_bottles = 0
                break
            else:
                refill[i] = d - num_bottles[i]
                new_bottles -= refill[i]
        return refill

    def expected_cold_sodas(scheme: List[int]) -> int:
        cold_sodas = 0
        for bottles in num_bottles:
            cold_sodas += min(bottles, d - sum(scheme))
        return cold_sodas

    def max_cold_sodas(schemes: List[List[int]]) -> List[int]:
        max_cold_sodas = -1
        best_scheme = []
        for scheme in schemes:
            cold_sodas = expected_cold_sodas(scheme)
            if cold_sodas > max_cold_sodas:
                max_cold_sodas = cold_sodas
                best_scheme = scheme
        return best_scheme

    # Main solution
    schemes = [refill_scheme(num_bottles, n)]
    best_scheme = max_cold_sodas(schemes)

    if expected_cold_sodas(best_scheme) < m:
        return "impossible"
    else:
