    def h(n: int) -> int:
        if n == 1:
            return 1
        elif n % 2 == 0:
            return n + h(n // 2)
        else:
            return n + h(3 * n + 1)

    def sum_h(n: int) -> int:
        sequence = []
        while n != 1:
            sequence.append(n)
            if n % 2 == 0:
                n = n // 2
            else:
                n = 3 * n + 1
        sequence.append(1)
        return sum(sequence)

    return str(sum_h(n))

